    <head>
        <meta charset="UTF-8">
        <title>Midi Player</title>
        <script src='midijs/midi.js'></script>
        <script src="/c/libs/jquery.min.js"></script>
        <style>
            @import url(/c/sys42.css); @import url(/c/sys/skins/w93.css); html {
                background: silver;
            }

            body {
                overflow: hidden;
                width: 100%;
                height: 100%;
            }

            ul {
                padding: 0;
                margin: 0;
                display: none;
            }

            li {
                padding-left: 10px;
                cursor: pointer;
                list-style: none;
            }

            #playlist > ul > li:nth-child(2n) {
                background-color: #eee;
            }

            li:hover, #playlist > ul > li:nth-child(2n):hover {
                color: #000;
                background: #C3FF00;
            }

            #folders {
                width: calc(100% - 0px);
                color: black;
                position: fixed;
                top: 30px;
                left: 0;
                padding: 7px;
                background: darkgray;
                height: 36px;
                border-bottom: 1px solid gray;
            }

            #console {
                width: calc(100% - 0px);
                background: black;
                color: #C3FF00;
                border: 5px solid black;
                position: fixed;
                top: 0;
                left: 0;
                height: 30px;
                padding: 3px;
            }

            #console:hover {
                background: red;
                border: 5px solid red;
                cursor: not-allowed;
            }

            #playlist {
                position: absolute;
                top: 67px;
                background: white;
                left: 0;
                width: calc(100% - 0px);
                height: calc(100% - 40px);
                overflow-y: scroll;
                overflow-x: hidden;
                margin-left: 0px;
                margin-right: 10px;
            }

            .folder {
                cursor: pointer;
                text-align: center;
            }

            .folder:hover {
                background: #C3FF00;
                color: #000;
            }

            button.fClicked {
                color: #dfdfdf;
                border-top: 1px solid gray;
                border-left: 1px solid gray;
                border-right: 1px solid gray;
                border-bottom: 1px solid gray;
                box-shadow: inset 1px 1px #000,1px 0 #dfdfdf,0 1px #dfdfdf,1px 1px #dfdfdf;
                background-color: gray;
            }

            #download {
                display: none;
            }
        </style>
    </head>
